**	Only needed when setting up this demo - stored in the frame thereafter
*/
#define $SEATINGPLANFILE	'C:\Development\_RELEASES\6.2\Changes\Beta3\OR-Demos\aircraftseating.jpg'

procedure LoadSeatingPlanImage(

)=
declare
	lbo		= LongByteObject;
enddeclare
{
	$INFO('Reading seating plan image in from file');
	lbo.FileHandle = '$SEATINGPLANFILE';
	curframe.TopForm.SetTaggedValue(
		tag='bitmaps#aircraftseating.jpg', item=lbo);
	FrameSource(curframe.ObjectSource).TopForm.SetTaggedValue(
		tag='bitmaps#aircraftseating.jpg', item=lbo);

	return lbo;
}

