COMPONENT.script:
/*
**  Demo Name:	AirlineSeating
**
**  Description:
**		Enables a passenger to change their airline seat, by dragging
**		their sprite to an alternative location.
**
**  Features:
**
**	o	The seatingplan bitmap is stored in the frame, not as a BMP but
**		as a JPEG (in a longbyteobject taggedvalue item). Consequently:
**		* its stored size is 15,000 times reduced (150KB).
**	o	The 330 passengers displayed on the seats are not fields but
**		sprites, derived from 4 icons contained in the seatingplan
**		bitmap. Consequently:
**		*  their display is orders of magnitude more efficient
**		*  their appearance can be manipulated in many ways (including
**		   rotation)
**		*  when they are dragged, the cursor is identical to the sprite
**	o	The sprite icons were taken from a palettefield on the frame.
**		Consequently:
**		*  you can change the palettefield images to substitute your own
**
**	about sprite icons:
**		*  they can be dragged off the field plan and dropped in a
**		   different field or frame, if required
**		*  they can respond to a wide variety of mouse and timed
**		   actions, including mouse enter, exit, hover, down, up, and
**		   drag.
**		*  there are several built in responses, and you can define your
**		   own.
**
**  Dependencies:
**		None.
**
*/

#define $TEST_PREVIEW		'1'

#define $INFO			'curframe.Trace'
#define $WARN			'$INFO'
#define $STATUSTEXT		'curframe.StatusText = '
#define $STATE			'$INFO(curframe.StatusText)'

//  Define the seatstate codes
//  Define the available seats (in reality these would come from the database)
#define $SEATSTATES		'u?xP'	-- u=untaken, ?=maybe, x=unavailable, P=passenger
#define $AVAILABLES		'u2G u5H u5J ?21B ?32C P32J u44B'

//  Define the OS file containing the seating plan (only needed when setting
//  up this demo - stored in the frame thereafter
#define $SEATINGPLANFILE	'C:\Development\_RELEASES\6.2\Changes\Beta3\OR-Demos\aircraftseating.jpg'

initialize()=
declare
	seats			= ChoiceList;
	board			= ButtonField default null;
	cursor			= CursorBitmap;
	IE			= InputEvent;
	SD			= SpriteDescriptor;
	SDS			= array of SpriteDescriptor;
	eventkey		= varchar(32) not null;
	status			= integer not null;
	pieceX			= integer not null;
	pieceY			= integer not null;
	pieceW			= integer not null;
	pieceH			= integer not null;
	pixeldensity		= float4 not null;
	map			= StringObject;
	seatingmap		= StringObject default null;

	hiddensub		= SubForm;
	oversub			= SubForm;
	boardcopy		= SubForm default null;
	pic			= ImageField;
	bitmap			= BitmapObject;
	spriteset		= BitmapObject;
	i			= integer not null;
	rc			= integer not null;
	pics			= array of ChoiceDetail default null;
	spriteicons		= array of BitmapObject;
	bitmapimages		= array of BitmapObject;
	spriteimage		= BitmapObject;
	bitmapimage		= BitmapObject;
	lbo			= LongByteObject default null;

	string			= StringObject;
	ct			= integer not null default 0;
	seatnames		= array of StringObject;

	seat			= procedure returning varchar(32) not null;
	SetTheAvailableSeats	= procedure returning StringObject;
	MapTheSeats		= procedure returning StringObject;
	FieldSpritemap		= procedure returning StringObject;
	MovePassenger		= procedure returning spriteDescriptor;
	ProcessSeatChange	= procedure returning integer not null;
	LoadSeatingPlanImage	= procedure returning LongByteObject;
enddeclare
{
	/*
	**  Get the aircraft seatingplan bitmap from a frame-stored jpeg;
	**  Read it from file and store it ..if it is not already stored
	*/
	curframe.TopForm.FetchTaggedValue(
		tag='bitmaps#aircraftseating.jpg', item=Byref(lbo));
	if lbo is null then
		lbo = LoadSeatingPlanImage();
	endif;
	bitmapimage.LoadLong(object=lbo);

	/*
	**  Set necessary variables; get the aircraft bitmap dimensions
	*/
	pixeldensity = Float4(cursession.PixelScreenWidth) / Float4((cursession.ScreenWidth));
	board = field(airplane);
	board.Width = bitmapimage.WidthPixels/pixeldensity;
	board.Height = bitmapimage.HeightPixels/pixeldensity;

	/*
	**  Include the passenger sprite images in the bitmap
	*/
	pics = field(images).ValueList.ChoiceItems;
	for i = 1 to pics.LastRow do
		spriteicons.InsertRow(
			rownumber=i, rowobject=pics[i].EnumBitmap.Duplicate());
	endfor;

	spriteimage.BlankBitmap(width=100, height=1);
	spriteimage.ComposeBitmap(elementtype=BE_ICON, elements=spriteicons);

	bitmapimages.InsertRow(rownumber=1, rowobject=bitmapimage);
	bitmapimages.InsertRow(rownumber=2, rowobject=spriteimage);

	bitmap.ComposeBitmap(
		elementtype=BE_IMAGE, elements=bitmapimages, hasicons=TRUE);

	/*
	**  Display the bitmap as a Bdp-enabled field background
	*/
	board.BgBitmap = bitmap;
	board.BgBitmap.CornerRadius = 3;
	board.BgPattern = FP_BITMAPCLEAR;
	board.BgDisplayPolicy = BDP_BORDEREDTILED;

	/*
	**  Define the 300 seats as bdp sectors
	*/
	map.ConcatVarchar(text='$');
	map.ConcatString(string=MapTheSeats());
	board.UpdBackground(spritemap=map);

	seatingmap = map;
	seatingmap.LeftTruncate(1);

	/*
	**  Position the passenger sprites in the appropriate sectors
	*/
	map = SetTheAvailableSeats(usesectors=TRUE, includetakens=TRUE);

	/*
	**  Set the drag cursor to be a copy of the sprite
	*/
	eventkey = IE.EventKey(action=IE_LMOUSEDOWN, modifierkey=KB_NONE);
	IE.LoadEventBehavior(location=board, eventkey=eventkey,
		responsetype='sprite_cursors', response=cursor);

	/*
	**  Tidy the frame
	*/
	curframe.IsAutoSized = TRUE;
}


//~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
//	Draw the initial display, once the frame is fully realized
//~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
on userevent 'just realized ...' =
{
	board.UpdBackground(spritemap=curframe.MessageObject);
}


//~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
//	Handle a seat change
//~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
/*
**	This uses the mouseenter event you get at the end of a drag when the
**	mouse is released, as this is processed after the intrinsic drag
**	handling has completed, whereas mouseup is processed earlier, and
**	too soon for our purposes. The alternative is to post a userevent
**	from the mouseup event block, and do the work when that processes.
**
*/
on childmouseenter =
{
	if curframe.ReasonCode != RC_MOUSEUNCAPTUREDLOCAL then
		resume;
	endif;

	rc = ProcessSeatChange();
}



//@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@
//			PROCEDURES	1. SEAT CHANGE
//@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@
procedure ProcessSeatChange(

)=
declare
	spritemap		= StringObject;
	rc			= integer not null;
	seat			= SpriteDescriptor default null;
enddeclare
{
	/*
	**  Attempt to honour the passenger drag just completed
	*/
	seat = MovePassenger();

	/*
	**  Inform the user of the outcome
	*/
	if seat is null then
		$STATUSTEXT('You cant sit here!'); $STATE;
		resume;
	endif;

	$STATUSTEXT('Moving you to seat ' + IfNull(seat.Name, 'in baggage hold') +
		 ', sector ' + Ifnull(varchar(seat.sector), 'unclaimed')); $STATE;

}


//~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
//	Handle any passenger move
//~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
procedure MovePassenger(

	passenger		= SpriteDescriptor default null;
	targetseat		= SpriteDescriptor default null;

)=
declare
	spritemap	= StringObject;
	tokens		= array of StringObject default null;
	targetindex	= integer not null;
	passengerindex	= integer not null;
	passengerseat	= varchar(256) not null;
	passengersector	= integer not null;
enddeclare
{
	/*
	**  Make sure we have the descriptors of the passenger and the target
	**  seat (actually just having the sprite indices is enough)
	*/
	if targetseat is null then
		IE.LastInputAction(action='mousedrag_up');
		targetseat = IE.Sprite;
	endif;

	if passenger is null then
		IE.LastInputAction(action='mousedrag');
		passenger = IE.Sprite;
	endif;

	if targetseat is null or passenger is null then
			return null;
	elseif targetseat.SpriteIndex is null or passenger.SpriteIndex is null then
			return null;
	endif;

	targetindex = IfNull(targetseat.Spriteindex,0);
	passengerindex = IfNull(passenger.Spriteindex,0);

	/*
	**  Swap the descriptors in the spritemap
	**  (since the vacated seat is now available)
	*/
	spritemap.Value = '?';
	board.UpdBackground(spritemap=Byref(spritemap));
	tokens = spritemap.Split(delimiter=';');

	passengersector = IfNull(passenger.Sector,0);
	passengerseat = IfNull(passenger.Name,'');

	passenger.SetAttribute(
		sector = targetseat.Sector, name = targetseat.Name);
	targetseat.SetAttribute(
		sector = passengersector, name = passengerseat);

	tokens[passengerindex] = passenger.SpriteMap();
	tokens[targetindex] = targetseat.SpriteMap();

	spritemap = spritemap.Join(strings=tokens, delimiter=';');
	board.UpdBackground(spritemap=spritemap);

	return passenger;
}


//@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@
//			PROCEDURES	2. SETUP
//@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@


//~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
//	Set the available seats
//~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
/*
**  Name:	SetTheAvailableSeats
**
**  Description:
**	Create a spritemap to display the available seats, with or
**	without the taken seats.
**
*/
procedure SetTheAvailableSeats(

	availables	= varchar(256) not null default '$AVAILABLES';
	usesectors	= integer not null default FALSE;
	noapply		= integer not null default FALSE;			//to get a sample to use for mapsectors
	includetakens	= integer not null default FALSE;

)=
declare
	i		= integer not null;
	map		= StringObject;
	seatstates	= varchar(32) not null default '$SEATSTATES';
	seatstate	= varchar(32) not null;
	indx		= integer not null;
	seatname	= varchar(32) not null;
	pos		= varchar(32) not null;
	responseflags	= varchar(32) not null default '';
	tokens		= array of StringObject default null;
	avlist		= array of StringObject default null;
	occupant	= StringObject default null;
enddeclare
{
	/*
	**  List the available seats from the availables string
	*/
	tokens = ToString(text=Squeeze(availables)).Split(delimiter=' ');

	/*
	** Optionally add sprites for passengers with seats
	*/
	if includetakens = TRUE then
		avlist = tokens.Duplicate();
		for i = 1 to seatnames.LastRow do
			if avlist.Find(attributename='value',
				searchstring='_' + seatnames[i].Value) = ER_OK then
				continue;
			endif;
			occupant = seatnames[i].Duplicate();
			occupant.Value = 'x' + occupant.Value;
			tokens.InsertRow(
				rownumber=tokens.LastRow+1, rowobject=occupant);
		endfor;
	endif;

	/*
	**  Build spritemap of passengers we want to show
	*/
	map.Value = '';
	map.ConcatVarchar(text='+');

	for i = 1 to tokens.LastRow do
		/*
		**  Get the status, name and position of this seat;
		*/
		seatstate = Left(tokens[i].value, 1);
		indx = Locate(seatstates, seatstate);
		if indx > Size(seatstates) then
			$WARN('There is no seatstate code "' + seatstate + '"');
			resume;
		endif;

		seatname = Shift(tokens[i].value, -1);
		pos = seat(name=seatname, usesectors=usesectors);

		if pos = '' then
			$WARN('There is no seat "' + seatname + '"');
			resume;
		endif;

		/*
		**  Build a spritedef for this seat and add it to the spritemap:
		**  Only allow the specified passenger to be draggable
		*/
		if seatstate = 'P' then
			responseflags = '(:3)';	//drag + hotcursor
		else
			responseflags = '';
		endif;

		map.ConcatVarchar(text=
			varchar(indx) +
			'"' + seatname + '"' +
			responseflags +
			' ' +
			pos + ';' /*+ HC_NEWLINE*/);
	endfor;

	/*
	**  No idea what this is for
	*/
	map.RightTruncate(map.Length);

	/*
	**  Pass back the map without applying it ..if so specified, or
	**  Post a userevent which will display the map ..if the frame is unrealized, or
	**  Display the map right now ..otherwise
	*/
	if noapply = TRUE then
		return map;
	elseif curframe.WindowVisibility = WV_UNREALIZED then
		curframe.SendUserEvent(
			eventname='just realized ...', messageobject=map);
	else
		board.UpdBackground(spritemap=map);
	endif;

	/*
	**  Give the complete spritemap to the caller
	*/
	return map;
}


//~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
//	Map the seats
//~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
/*
**  Name:	MapTheSeats
**
**  Description:
**	Create a sectormap where each sector corresponds to one of the 336
**	seats.
**	Most seats but not all are regularly spaced, so the logic
**	below will vary from aircraft to aircraft.
**	Seat sizes vary too: sectors for first class seats are 25x29 pixels,
**	others are 20x22 pixels.
**	Each sector is defined using standard sprite definition string, except
**	that the spritesource index at the start is always 1 (there isnt an icon
**	associated with a sector; the 1 is to satisfy the format), and the sector
**	is always 1 - the sector number is computed at runtime to avoid risk
**	of duplication; typically it is the sector name that is used for
**	identification. The format is as follows:
**
**	1		the spritesourceindex - for compatibility, always 1
**	"name"		the sector name - for identification
**	{w,h}		the sector size - may be absolute or %
**	single space
**	1:		the sector number - placeholder, computed at runtime
**	CC		gravity: anchor is centered
**	+x,y		position relative to the sector and anchor
**
*/
procedure MapTheSeats(

)=
declare
	i		= integer not null;
	map		= StringObject;
	string		= StringObject;
	name		= varchar(32) not null;
	pos		= varchar(32) not null;
	row		= integer not null;
	aisle		= integer not null;
	lettersEC	= varchar(32) not null default 'ABC DEF GHJ';
	lettersBC	= varchar(32) not null default 'ABC DEF GHJ';
	letters1C	= varchar(32) not null default 'AB CG HJ';
	letter		= varchar(32) not null default '';
	nl		= varchar(32) not null default HC_NEWLINE;
enddeclare
{
	map.Value = '';

	/*
	**  Map sectors for the First Class seats
	*/
	for row = 1 to 5 do
		for aisle = 1 to 8 do
			letter = CharExtract(letters1C, aisle);
			if letter = '' then
				continue;
			endif;
			i = i + 1;
			name = varchar(row) + letter;
			seatnames[seatnames.LastRow+1].Value = name;

			pos = varchar(235 + (row-1)*46 + 5*((8-aisle)/7)) + ',' + varchar(360 - (aisle-1)*32 + (aisle/3)*4 + (aisle/6)*3);

			string.Value = '1"' + name + '"{25,29} 1:CC+' + pos + ';' + HC_NEWLINE;
			string.Value = '1"' + name + '"{25,29} 1:CC+' + pos + ';' + HC_NEWLINE;
			map.ConcatString(string=string);
		endfor;
	endfor;

	/*
	**  Map sectors for the Business Class seats
	*/
	for row = 11 to 26 do
		for aisle = 1 to 11 do
			letter = CharExtract(lettersBC, aisle);
			if letter = '' then
				continue;
			endif;
			i = i + 1;
			name = varchar(row) + letter;
			seatnames[seatnames.LastRow+1].Value = name;

			pos = varchar(485 + 25*(row-11)) + ',' + varchar(380 - (aisle-1)*25 + 5*(aisle/4));

			string.Value = '1"' + name + '"{20,22} 1:CC+' + pos + ';' + HC_NEWLINE;
			map.ConcatString(string=string);
		endfor;
	endfor;

	/*
	**  Map sectors for the Economy Class seats
	*/
	for row = 27 to 44 do
		for aisle = 1 to 11 do
			letter = CharExtract(lettersEC, aisle);
			if letter = '' then
				continue;
			endif;
			i = i + 1;
			name = varchar(row) + letter;
			seatnames[seatnames.LastRow+1].Value = name;

			pos = varchar(918 + 25*(row-27)) + ',' + varchar(380 - (aisle-1)*25 + 5*(aisle/4));

			string.Value = '1"' + name + '"{20,22} 1:CC+' + pos + ';' + HC_NEWLINE;
			map.ConcatString(string=string);
		endfor;
	endfor;

	map.RightTruncate(map.Length);

	return map;
}


//~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
//	Get the name of the seat from the position, or vice versa
//~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
procedure Seat(

	name		= varchar(32) not null;
	pos		= varchar(32) not null;
	sector		= varchar(32) not null;
	usesectors	= integer not null default FALSE;

)=
declare
	i		= integer not null;
	sectorno	= integer not null;
	sectorname	= varchar(32) not null;
	sectorpos	= varchar(32) not null;
	seatdefs	= array of StringObject default null;
	props		= array of StringObject default null;
enddeclare
{
	/*
	**  Populate a choicelist of seat (sector) number, name and position
	**  ..if it hasnt been done before
	**  (get this from the sector map)
	*/
	if seats.ChoiceItems.LastRow = 0 then
		seatdefs = seatingmap.Split(delimiter=';');
		for i = 1 to seatdefs.LastRow do
			props = seatdefs[i].Split(delimiter='"\,+', minrows=4);
			sectorno = i;
			sectorname = props[2].Value;
			sectorpos = props[4].Value;

			seats.AddItem(
				enumvalue=sectorno,
				textvalue=sectorname,
				displayvalue=sectorpos,
				bitmapvalue=null);
		endfor;
	endif;

	/*
	**  Use the map to return seat (sector) or position details
	**  given name (which one depends on whether usesectors is set), or to
	**  return name given sector or position details
	*/
	if name != '' and usesectors = TRUE then
		i = seats.ValueByText(textvalue=name);
		sector = varchar(i) + ':CC+0,0';
		if i = CL_INVALIDVALUE then
			sector = '';
		endif;
		return sector;
	elseif name != '' then
		pos = seats.DisplayByText(textvalue=name);
		return pos;
	elseif sector != '' then
		pos = seats.DisplayByValue(textvalue=int4(sector));
		return pos;
	else
		name = seats.TextByDisplay(displayvalue=pos);
		return name;
	endif;
}


