//~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
//	Set the available seats
//~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
/*
**  Name:	SetTheAvailableSeats
**
**  Description:
**	Create a spritemap to display the available seats, with or
**	without the taken seats.
**
*/
procedure SetTheAvailableSeats(

	availables		= varchar(256) not null default '$AVAILABLES';
	usesectors		= integer not null default FALSE;
	noapply			= integer not null default FALSE;			//to get a sample to use for mapsectors
	includetakens	= integer not null default FALSE;

)=
declare
	i				= integer not null;
	map				= StringObject;
	seatstates		= varchar(32) not null default '$SEATSTATES';
	seatstate		= varchar(32) not null;
	indx			= integer not null;
	seatname		= varchar(32) not null;
	pos				= varchar(32) not null;
	tokens			= array of StringObject default null;
	avlist			= array of StringObject default null;
	occupant		= StringObject default null;

	descriptors		= array of SpriteDescriptor;
	descriptor		= SpriteDescriptor default null;
	spriteindex		= integer not null;
	sector			= integer not null;
	responseflags	= integer default null;
enddeclare
{
	/*
	**  List the available seats from the availables string
	*/
	tokens = ToString(text=Squeeze(availables)).Split(delimiter=' ');

	/*
	** Optionally add sprites for passengers with seats
	*/
	if includetakens = TRUE then
		avlist = tokens.Duplicate();
		for i = 1 to seatnames.LastRow do
			if avlist.Find(attributename='value',
				searchstring='_' + seatnames[i].Value) = ER_OK then
				continue;
			endif;
			occupant = seatnames[i].Duplicate();
			occupant.Value = 'x' + occupant.Value;	//the "x" means unavailable
			tokens.InsertRow(
				rownumber=tokens.LastRow+1, rowobject=occupant);
		endfor;
	endif;

	/*
	**  Build spritemap of passengers we want to show
	*/
	for i = 1 to tokens.LastRow do

		/*
		**  Get the status, name and position of this seat;
		*/
		seatstate = Left(tokens[i].value, 1);
		indx = Locate(seatstates, seatstate);
		if indx > Size(seatstates) then
			$WARN('There is no seatstate code "' + seatstate + '"');
			resume;
		endif;

		seatname = Shift(tokens[i].value, -1);
		pos = seat(name=seatname, usesectors=usesectors);

		if pos = '' then
			$WARN('There is no seat "' + seatname + '"');
			resume;
		endif;

		/*
		**	Add this passenger to the spritemap
		*/
		if i = 1 then
			descriptors.Clear();
		endif;
		spriteindex = descriptors.LastRow + 1;
		descriptors.InsertRow(rownumber=spriteindex);
		descriptor = descriptors[spriteindex];

		if seatstate = 'P' then
			responseflags = RSP_DRAG;
		endif;

		sector = Int4(ToString(text=pos).Split(delimiter=':', exactrows=2)[1].Value);

		descriptor.SetAttribute(
			spritesourceindex=indx,
			name=seatname,
			flags=responseflags,
			sector=sector,
			gravity='CC',
			x=0,
			y=0);
	endfor;

	map = SD.SpriteMap(descriptors=descriptors, operation='add');

	/*
	**  Pass back the map without applying it ..if so specified, or
	**  Post a userevent to force display of the map ..if the frame is not yet realized, or
	**  Display the map right now ..otherwise
	*/
	if noapply = TRUE then
		return map;
	elseif curframe.WindowVisibility = WV_UNREALIZED then
		curframe.SendUserEvent(
			eventname='just realized ...', messageobject=map);
	else
		board.UpdBackground(spritemap=map);
	endif;

	/*
	**  Give the complete spritemap to the caller
	*/
	return map;
}


//~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
//	Map the seats
//~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
/*
**  Name:	MapTheSeats
**
**  Description:
**	Create a sectormap where each sector corresponds to one of the 336
**	seats.
**	Most seats but not all are regularly spaced, so the logic
**	below will vary from aircraft to aircraft.
**	Seat sizes vary too: sectors for first class seats are 25x29 pixels,
**	others are 20x22 pixels.
**	Each sector is defined using standard sprite definition string, except
**	that the spritesource index at the start is always 1 (there isnt an icon
**	associated with a sector; the 1 is to satisfy the format), and the sector
**	is always 1 - the sector number is computed at runtime to avoid risk
**	of duplication; typically it is the sector name that is used for
**	identification. The format is as follows:
**
**	1		the spritesourceindex - for compatibility, always 1
**	"name"		the sector name - for identification
**	{w,h}		the sector size - may be absolute or %
**	single space
**	1:		the sector number - placeholder, computed at runtime
**	CC		gravity: anchor is centered
**	+x,y		position relative to the sector and anchor
**
*/
procedure MapTheSeats(

)=
declare
	i			= integer not null;
	map			= StringObject;
	string		= StringObject;
	name		= varchar(32) not null;
	pos			= varchar(32) not null;
	row			= integer not null;
	aisle		= integer not null;
	lettersEC	= varchar(32) not null default 'ABC DEF GHJ';
	lettersBC	= varchar(32) not null default 'ABC DEF GHJ';
	letters1C	= varchar(32) not null default 'AB CG HJ';
	letter		= varchar(32) not null default '';
	nl			= varchar(32) not null default HC_NEWLINE;
	x			= integer not null default 0;
	y			= integer not null default 0;
	descriptors	= array of SpriteDescriptor;
	descriptor	= SpriteDescriptor default null;
	spriteindex	= integer not null;
enddeclare
{
	map.Value = '';

	/*
	**  Map sectors for the First Class seats
	*/
	for row = 1 to 5 do
		for aisle = 1 to 8 do
			letter = CharExtract(letters1C, aisle);
			if letter = '' then
				continue;
			endif;
			i = i + 1;
			name = varchar(row) + letter;
			seatnames[seatnames.LastRow+1].Value = name;

#if 1 --
			if i = 1 then
				descriptors.Clear();
			endif;
			spriteindex = descriptors.LastRow + 1;
			descriptors.InsertRow(rownumber=spriteindex);
			descriptor = descriptors[spriteindex];

			x = 235 + (row-1)*46 + 5*((8-aisle)/7);
			y = 360 - (aisle-1)*32 + (aisle/3)*4 + (aisle/6)*3;

			descriptor.SetAttribute(
				spritesourceindex=1,
				name=name,
				width = 25,
				height = 29,
				sector=1,
				gravity='CC',
				x=x,
				y=y);
#else --
			pos = varchar(235 + (row-1)*46 + 5*((8-aisle)/7)) + ',' + varchar(360 - (aisle-1)*32 + (aisle/3)*4 + (aisle/6)*3);

			string.Value = '1"' + name + '"{25,29} 1:CC+' + pos + ';' + HC_NEWLINE;
			string.Value = '1"' + name + '"{25,29} 1:CC+' + pos + ';' + HC_NEWLINE;
			map.ConcatString(string=string);
#endif --
		endfor;
	endfor;

	/*
	**  Map sectors for the Business Class seats
	*/
	for row = 11 to 26 do
		for aisle = 1 to 11 do
			letter = CharExtract(lettersBC, aisle);
			if letter = '' then
				continue;
			endif;
			i = i + 1;
			name = varchar(row) + letter;
			seatnames[seatnames.LastRow+1].Value = name;

#if 1 --
			spriteindex = descriptors.LastRow + 1;
			descriptors.InsertRow(rownumber=spriteindex);
			descriptor = descriptors[spriteindex];

			x = 485 + 25*(row-11);
			y = 380 - (aisle-1)*25 + 5*(aisle/4);

			descriptor.SetAttribute(
				spritesourceindex=1,
				name=name,
				width = 20,
				height = 22,
				sector=1,
				gravity='CC',
				x=x,
				y=y);
#else --
			pos = varchar(485 + 25*(row-11)) + ',' + varchar(380 - (aisle-1)*25 + 5*(aisle/4));

			string.Value = '1"' + name + '"{20,22} 1:CC+' + pos + ';' + HC_NEWLINE;
			map.ConcatString(string=string);
#endif --
		endfor;
	endfor;

	/*
	**  Map sectors for the Economy Class seats
	*/
	for row = 27 to 44 do
		for aisle = 1 to 11 do
			letter = CharExtract(lettersEC, aisle);
			if letter = '' then
				continue;
			endif;
			i = i + 1;
			name = varchar(row) + letter;
			seatnames[seatnames.LastRow+1].Value = name;

#if 1 --
			spriteindex = descriptors.LastRow + 1;
			descriptors.InsertRow(rownumber=spriteindex);
			descriptor = descriptors[spriteindex];

			x = 918 + 25*(row-27);
			y = 380 - (aisle-1)*25 + 5*(aisle/4);

			descriptor.SetAttribute(
				spritesourceindex=1,
				name=name,
				width = 20,
				height = 22,
				sector=1,
				gravity='CC',
				x=x,
				y=y);
#else --
			pos = varchar(918 + 25*(row-27)) + ',' + varchar(380 - (aisle-1)*25 + 5*(aisle/4));

			string.Value = '1"' + name + '"{20,22} 1:CC+' + pos + ';' + HC_NEWLINE;
			map.ConcatString(string=string);
#endif --
		endfor;
	endfor;

#if 1 --
	map = SD.SpriteMap(descriptors=descriptors, operation='apply');
#else --
	map.RightTruncate(map.Length);
#endif --

	return map;
}


//~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
//	Get the name of the seat from the position, or vice versa
//~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
procedure Seat(

	name		= varchar(32) not null;
	pos		= varchar(32) not null;
	sector		= varchar(32) not null;
	usesectors	= integer not null default FALSE;

)=
declare
	i		= integer not null;
	sectorno	= integer not null;
	sectorname	= varchar(32) not null;
	sectorpos	= varchar(32) not null;
	seatdefs	= array of StringObject default null;
	props		= array of StringObject default null;
enddeclare
{
	/*
	**  Populate a choicelist of seat (sector) number, name and position
	**  ..if it hasnt been done before
	**  (get this from the sector map)
	*/
	if seats.ChoiceItems.LastRow = 0 then
		if seatingmap.Value like '$%' then
			seatingmap.LeftTruncate(1);
		endif;
		seatdefs = seatingmap.Split(delimiter=';');
		for i = 1 to seatdefs.LastRow do
			props = seatdefs[i].Split(delimiter='"\,+', minrows=4);
			sectorno = i;
			sectorname = props[2].Value;
			sectorpos = props[4].Value;

			seats.AddItem(
				enumvalue=sectorno,
				textvalue=sectorname,
				displayvalue=sectorpos,
				bitmapvalue=null);
		endfor;
	endif;

	/*
	**  Use the map to return seat (sector) or position details
	**  given name (which one depends on whether usesectors is set), or to
	**  return name given sector or position details
	*/
	if name != '' and usesectors = TRUE then
		i = seats.ValueByText(textvalue=name);
		sector = varchar(i) + ':CC+0,0';
		if i = CL_INVALIDVALUE then
			sector = '';
		endif;
		return sector;
	elseif name != '' then
		pos = seats.DisplayByText(textvalue=name);
		return pos;
	elseif sector != '' then
		pos = seats.DisplayByValue(textvalue=int4(sector));
		return pos;
	else
		name = seats.TextByDisplay(displayvalue=pos);
		return name;
	endif;
}


//~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
//	Get a field's spritemap
//~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
procedure FieldSpritemap(

	hostfield	= ActiveField default null;
)=
declare
	spritemap		= StringObject;
enddeclare
{
	spritemap.Value = '?';
	hostfield.UpdBackground(spritemap=Byref(spritemap));
	return spritemap;
}


