COMPONENT.script:
/* ** AirlineSeating */ Required components: none Required included applications: none Other requirements: none
Demo: w4gldev rundbapp remotehost::or62demos D201504_AllocationSystems -cAirlineSeating
Drag the "yellow" passenger to one of the available seats, and drop the passenger there During the drag, the drag cursor "is" the yellow passenger After the drop, the yellow passenger now occupies the drop seat, the previous seat is now available, and a status bar message identifies the new seat. Note that each of the 300 passengers, including the yellow one, is a sprite image copied and customized from the 4 sprite icons in the BgBitmap Note that during the drag, the drag cursor-image is a copy of the customized sprite image Note that this drag behaviour is built into OpenROAD, and does not require 4GL code, although you can supply code if you want.
/* ** AirlineSeating (code) */ Required components: none Required included applications: none Other requirements: none
Demo: w4gldev runimage workbnch.img -Tall -/appflags profile=or62demos application=allocationsystems component=airlineseating command=openscript#561
Note that the code is creating a spritedescriptor definition for each Economy seat, treating it as a sector, computing each seat''s size and x & y. Then the code creates a sectormap from the descriptors, and stores it in the "seating plan" bitmap. Go to line 265 Note that whenever a passenger is dragged to a new seat, the code just calls the LastInputAction method, once to identify the passenger (action= 'mousedrag_down') and once to identify the seat (action='mousedrag_up').
